  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset consists of digital still
  images from the Hawaii Coral Reef Assessment and Monitoring Program (CRAMP) taken
  2011-2012 from 29 sites within 5 main Hawaiian Islands (Kauai, Oahu, Molokai, Maui,
  and Hawaii). During 2011, only sites on Maui were surveyed. Most sites consist of
  two transects along different isobaths, shallow (~2-4m) and deep (~7-13m) lines.
  A total of 71 transects were completed between June 2011 - December 2012. This dataset
  only contains the images from which quantitative estimates of substrate type and
  species were acquired. The quantitative estimates in text comma-separated format
  are stored within a separate NODC accession, 0117490.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
